import React from "react";
import { withRouter } from "react-router-dom";
import "./Navbar.css";
import CornerLink from "./CornerLink";
import AboutLink from "./AboutLink";
import HomeLink from "./HomeLink";
import ProjectsLink from "./ProjectsLink";
import { useLocation } from "react-router-dom";
const hideHome = (props) => {
  const { location } = props;
  if (location.pathname.match(/about/)) {
    return null;
  }
  return <HomeLink />;
};

const ComponentThatHides = withRouter(hideHome);
export default function Navbar() {
  return (
    <>
      <nav>
        <div className="menu-wrap">
          <CornerLink />
          <input id="this" type="checkbox" className="toggler" />
          <div className="hamburger">
            <div></div>
          </div>
          <div className="menu">
            <div className="pageLinks">
              <div></div>
              <AboutLink />
              <ProjectsLink />
              <a
                href="html/resume.docx"
                download="resume.docx"
                className="pageLink"
              >
                Resume
              </a>
              <a href="https://tzeini.web.app" className="pageLink">
                Tree
              </a>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}
